function GetArea(module,code,val,fill,text,set){
    $.ajax
    ({ 
       type: "POST",
       url: "/chon-mau-xe?module="+module+"&"+code+"="+val, 
       success: function(response)
       {
           $("#"+fill).html('<option value="">'+text+'</option>')
           $("#"+fill).append(response);
           if(set!=''){
              $("#"+fill).select2('val',set);
           }else{
              $("#"+fill).select2();
           }
           
       }            
    });
}
